rcumstances, where the subject acquires great complexity.\n.\nOf all the mechanisms proposed for subsidence, thermal causes and the complementary effect of sediment load are the most discussed.\n.\n@scottc011 .\n.\n.\n.\n.\n.\n.\n.\n.\n.\n#life #lifestyle #geo #geomorphology #earth #terra #sand #sandstone #rock #trip #trilha #travel #geologia #geology #geolog\u00eda #geografia #geography #natgeo #natgeotravel #landscapephotography #landscape"}}]},"shortcode":"B9xYhRYpFob","edge_media_to_comment":{"count":31},"taken_at_timestamp":1584312500,"dimensions":{"height":919,"width":750},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/89820882_2066310663515042_2244732878555844086_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=102\u0026_nc_ohc=JJm-c42e-qoAX-7gvNN\u0026oh=ad6d5edb6f4b53a9608e35130451a241\u0026oe=5EA42407","edge_liked_by":{"count":558},"edge_media_preview_like":{"count":558},"owner":{"id":"4736442211"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/c0.81.720.720a/s640x640/89820882_2066310663515042_2244732878555844086_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=102\u0026_nc_ohc=JJm-c42e-qoAX-7gvNN\u0026oh=5b0954a8af323982fec1f06443df734b\u0026oe=5E9EC616","thumbnail_resources":[{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c0.81.720.720a/s150x150/89820882_2066310663515042_2244732878555844086_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=102\u0026_nc_ohc=JJm-c42e-qoAX-7gvNN\u0026oh=d8d46b516f5c5d3a87ba5f6c1807f70e\u0026oe=5E9BEB22","config_width":150,"config_height":150},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c0.81.720.720a/s240x240/89820882_2066310663515042_2244732878555844086_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=102\u0026_nc_ohc=JJm-c42e-qoAX-7gvNN\u0026oh=73517b7b653599a36e09e80ff3095fea\u0026oe=5E9AB124","config_width":240,"config_height":240},{"src":"https://scontent-sjc3-1.cdninstagram.c edges":[{"node":{"text":"\u00bfComo ayudo el entrenamiento a m\u00ed salud? \ud83d\udcaa\ud83e\udd14\n\u2022\nEs sencillo hablar desde el punto de vista de un externo pero la verdad est\u00e1 cuando se experimentan los cambios con los a\u00f1os.\n\u2022\nAntes de entrenar 5 veces a la semana y conseguir el estado f\u00edsico en el que me encuentro hoy en d\u00eda, yo era una persona que sufr\u00eda much\u00edsimo de sinusitis, siempre estaba con alergia, estornudando, con un pa\u00f1ito para limpiarme, realmente yo lo sent\u00eda como una tortura diaria, despertar y pasar todo el d\u00eda en ese tema, intent\u00e9 de todo, mantener m\u00e1s limpieza, dejar de comer ciertas cosas, pastillas, ir al m\u00e9dico y nada, incluso las pastillas ya no me hac\u00edan nada.\ud83e\udd27\ud83e\udd27\n\u2022\nPor otro lado sufr\u00eda de asma, por lo que siempre ten\u00eda que estar pegado de un nebulizador que me ayudaba a respirar bien porque no pod\u00eda, sent\u00eda la respiraci\u00f3n muy corta, lo cual me limitaba a pasarla bien en muchas ocasiones, salir de noche, no pasar mucho fr\u00edo, tambi\u00e9n tengo otras malas experiencias como cansancio, ansiedad, entre otros.\ud83e\udd75\n\u2022\nLuego empec\u00e9 a entrenar, a asistir a un gimnasio 5 veces a la semana pero haciendo aunque sea 20 minutos de ejercicio los fines de semana tambi\u00e9n, hoy en d\u00eda rara vez me da alergia y no me ha dado un ataque de asma como en dos a\u00f1os, me siento bien, feliz conmigo mismo y siempre buscando mejorar.\ud83d\udcc8\n\u2022\nCon esto la invitaci\u00f3n es a hacer ejercicio, a caminar, a darle movimiento al cuerpo y comenzar a construir h\u00e1bitos saludables para disfrutar de una vida plena, pueden escribirme al privado para cualquier duda o para una asesor\u00eda online !! \ud83d\udcaa\ud83d\udcf2\ud83d\udcf2\n\u2022\n\u2022\n#salud #bienestar #vida #life #lifestyle #motivacion #deporte"}}]},"shortcode":"B9xRdnfnDSK","edge_media_to_comment":{"count":2},"taken_at_timestam
